import React from 'react';
import Information from '../components/Information'
import Content from '../components/Content'
import workExamples from "../workExamples"
import Rugby from "../Rugby"
import AFL from "../AFL"
import CK from "../CK"
import Ty from "../Ty"
import OGI from "../OGI"


const Home = (props) => {
    return (
        <div>
            <Information 
                title = {workExamples[0].title}
                position={workExamples[0].position}
                description={workExamples[0].description}
                platform1={workExamples[0].platform1}
                platform2={workExamples[0].platform2}
                platform3={workExamples[0].platform3}
                platform4={workExamples[0].platform4}
                platform5={workExamples[0].platform5}
            />

            <div className="dictionary">
            {Rugby.map((props) => (
                <Content
                    images={props.id}
                />
            ))}
            </div>

            <div className="dictionary">
            {AFL.map((props) => (
                <Content
                    images={props.id}
                />
            ))}
            </div>

            <div className="dictionary">
            {Ty.map((props) => (
                <Content
                    images={props.id}
                />
            ))}
            </div>

            <div className="dictionary">
            {CK.map((props) => (
                <Content
                    images={props.id}
                />
            ))}
            </div>

            <div className="dictionary">
            {OGI.map((props) => (
                <Content
                    images={props.id}
                />
            ))}
            </div>
        </div>
    )
}

export default Home;
